import React from 'react';
import { motion } from 'framer-motion';

const AboutPage = () => {
  const containerVariants = {
    hidden: { opacity: 0 },
    visible: { 
      opacity: 1,
      transition: { staggerChildren: 0.1 }
    }
  };

  const itemVariants = {
    hidden: { y: 20, opacity: 0 },
    visible: { 
      y: 0, 
      opacity: 1,
      transition: { duration: 0.6, ease: "easeOut" }
    }
  };

  return (
    <motion.div 
      className="min-h-screen bg-gray-100 p-8 font-sans"
      variants={containerVariants}
      initial="hidden"
      animate="visible"
    >
      <motion.h1 
        className="text-6xl font-bold mb-12"
        variants={itemVariants}
      >
        ABOUT US
      </motion.h1>

      <motion.div className="grid grid-cols-1 md:grid-cols-2 gap-8" variants={itemVariants}>
        <div>
          <h2 className="text-4xl font-semibold mb-4">5+</h2>
          <p className="text-xl">Years of Experience</p>
        </div>
        <div>
          <h2 className="text-4xl font-semibold mb-4">1000+</h2>
          <p className="text-xl">Satisfied Customers</p>
        </div>
        <div>
          <h2 className="text-4xl font-semibold mb-4">100%</h2>
          <p className="text-xl">Satisfaction Guaranteed</p>
        </div>
        <div>
          <h2 className="text-4xl font-semibold mb-4">24/7</h2>
          <p className="text-xl">Customer Support</p>
        </div>
      </motion.div>

      <motion.p 
        className="text-xl mt-12 max-w-2xl"
        variants={itemVariants}
      >
        JR Auto Detailing is committed to providing top-notch car care services. 
        Our team of expert detailers uses state-of-the-art techniques and premium products 
        to restore and maintain your vehicle's pristine condition.
      </motion.p>

      <motion.div 
        className="mt-12"
        variants={itemVariants}
      >
        <h2 className="text-2xl font-semibold mb-4">Our Services</h2>
        <ul className="list-disc list-inside">
          <li>Interior Detailing</li>
          <li>Exterior Detailing</li>
          <li>Paint Correction</li>
          <li>Ceramic Coating</li>
          <li>Headlight Restoration</li>
        </ul>
      </motion.div>

      <motion.div 
        className="mt-12 text-sm"
        variants={itemVariants}
      >
        <h3 className="font-semibold mb-2">CONTACT US</h3>
        <p>Email: info@jrautodetailing.com</p>
        <p>Phone: (555) 123-4567</p>
        <p>Address: 123 Auto Lane, Car City, ST 12345</p>
      </motion.div>
    </motion.div>
  );
};

export default AboutPage;
